def longest_subarray(a, k):
    if not a:
        return -1
    if len(a) == 1:
        return 1 if a[0] <= k else -1
    if a[0] > k:
        return -1
    if a[0] == k:
        return 1
    if a[0] + a[1] > k:
        return 1
    if a[0] + a[1] == k:
        return 2
    if a[0] + a[1] < k:
        return 2
    for i in range(2, len(a)):
        if a[i] > k:
            return i
        if a[i] == k:
            return i + 1
        if a[i] + a[i - 1] > k:
            return i
        if a[i] + a[i - 1] == k:
            return i + 1
        if a[i] + a[i - 1] < k:
            return i + 1
    return -1

