Here is a sample code for a chrome extension that takes screenshots of the current tab and saves them to a folder on your computer:
```
{
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "A chrome extension that takes screenshots of the current tab and saves them to a folder on your computer.",
  "manifest_version": 2,
  "permissions": [
    "activeTab",
    "tabs",
    "storage"
  ],
  "background": {
    "scripts": ["background.js"]
  },
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  },
  "content_scripts": [
    {
      "matches": ["<all_urls>"],
      "js": ["content.js"]
    }
  ]
}
```
```
// background.js
chrome.runtime.onInstalled.addListener(function() {
  chrome.storage.sync.set({color: '#3aa757'}, function() {
    console.log('The color is green.');
  });
});

chrome.tabs.onUpdated.addListener(function(tabId, changeInfo, tab) {
  if (changeInfo.status === 'complete') {
    chrome.tabs.captureVisibleTab(null, {}, function(dataUrl) {
      var filename = 'screenshot-' + Date.now() + '.png';
      chrome.downloads.download({
        url: dataUrl,
        filename: filename
      });
    });
  }
});
```
```
// content.js
chrome.runtime.sendMessage({action: 'get-color'}, function(response) {
  document.body.style.backgroundColor = response.color;
});
```
